import React from 'react';

function ViewTodo({ todo }) {
    console.log(todo)

    return (
        <div>
            {
                todo.map((item, index) => {
                    return (
                        <div key={index}>
                            <h2>{item.name}</h2>
                            <p>{item.email}</p>
                            <p>{item.task}</p>
                        </div>
                    )
                })
            }
        </div>
    );
}

export default ViewTodo;
